import React from 'react'

export default class Container extends React.Component {
    static getInitialProps = () => {
        console.log('test');
    }

    render () {
        return (
            <div className="streak streak-photo streak-md" style={{backgroundImage: "url('https://mdbootstrap.com/img/Photos/Others/architecture.jpg')", color: '#000000'}}>
                <div className="flex-center mask rgba-gradient">
                    <div className="container my-5">
                        {/*<h3 className="text-center pb-3 font-weight-bold wow fadeIn" data-wow-delay="0.2s"*/}
                        {/*    style={{visibility: "visible", animationName: "fadeIn", animationDelay: "0.2s"}}>*/}
                        {/*    <strong>{JSON.stringify(this)}Download our mobile app</strong>*/}
                        {/*</h3>*/}
                        <h6 className="text-center pb-4 font-weight-bold wow fadeIn" data-wow-delay="0.2s" style={{visibility: "visible", animationName: "fadeIn", animationDelay: "0.2s"}}>
                            Get 30 days trial
                        </h6>
                        <div className="row flex-center">
                            <a className="btn btn-white btn-rounded btn-lg orange-text font-weight-bold ml-0 wow fadeIn waves-effect waves-light"
                               data-wow-delay="0.2s"
                               style={{visibility: "visible", animationName: "fadeIn", animationDelay: "0.2s"}}>
                                <i className="fab fa-android pr-2" aria-hidden="true"></i> Play store
                            </a>
                            <a className="btn btn-white btn-rounded btn-lg orange-text font-weight-bold wow fadeIn waves-effect waves-light"
                               data-wow-delay="0.2s"
                               style={{visibility: "visible", animationName: "fadeIn", animationDelay: '0.2s'}}>
                                <i className="fab fa-apple pr-2" aria-hidden="true"></i> App store
                            </a>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}
